import './App.css';
import { BrowserRouter, Routes, Route ,Link} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

//Components
import ShowVecinos from './components/ShowVecinos';
import CreateVecino from './components/CreateVecino';
import EditVecino from './components/EditVecino';

const nav = () => {
  const home = '/';
  return (
      <div>
          <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <Link to={home} className='btn btn-primary mr-2'> EDIT </Link>
              <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                  <span class="navbar-toggler-icon"></span>
              </button>
              <div class="collapse navbar-collapse" id="navbarNav">
                  <ul class="navbar-nav">
                      <li class="nav-item active">
                          <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
                      </li>
                      <li class="nav-item">
                          <a class="nav-link" href="#">Features</a>
                      </li>
                      <li class="nav-item">
                          <a class="nav-link" href="#">Pricing</a>
                      </li>
                      <li class="nav-item">
                          <a class="nav-link disabled" href="#">Disabled</a>
                      </li>
                  </ul>
              </div>
          </nav>
      </div>
  )
}


function App() {
  return (
    <div className="App">

    <BrowserRouter>
      <Routes>
        <Route path='/' element={<ShowVecinos/>}></Route>
        <Route path='/create' element={<CreateVecino/>}></Route>
        <Route path='/edit/:id' element={<EditVecino/>}></Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
